    false,nt"url": null,nt"notes": "Backscatter imagery extracted from gridded
    bathymetry of the western and central banktop and bank edge environments at French
    Frigate Shoals, Northwestern Hawaiian Islands, USA. These data provide almost complete
    coverage between 20 and 100 meters. The backscatter dataset includes Simrad EM3002d
    and Reson 8101 data. The sonars frequencies are 300 kHz and 240 kHz respectively
    and are processed and gridded separately. Because of the similar sonar frequencies
    the data can be mosaicked nearly seamlessly using GIS software. This metadata is
    for the Reson 8101 backscatter data only.",nt"license_title": null,nt"extras":
